import { ActionTypes } from "../action-types";
import { SignIn } from '../actions/signin-action';
import { signin as signinRoute } from '../../api'
import { Dispatch } from "react";


export const signin = (signinParams: { email: string, password: string }) => {
    return async (dispatch: Dispatch<SignIn>) => {
        try {
            const { data } = await signinRoute(signinParams)
            dispatch({
                type: ActionTypes.SIGN_IN,
                payload: data
            });
        } catch (error) {
            console.log(error.message);
        }
    }
}
